import React, { useEffect, useState } from "react";
import ProductModel from "../../../Models/ProductModel";
import { Button, Header, Icon, Modal } from "semantic-ui-react";

const ProductManagementPage = () => {
  const [errorMessage, setErrorMessage] = useState("");
  const [products, setProducts] = useState<ProductModel[]>();
  const [open, setOpen] = React.useState(false);

  useEffect(() => {
    const fetchProducts = async () => {
      const url = `http://localhost:8080/api/products?sort=productId,asc`;
      const response = await fetch(url);
      if (!response.ok) {
        throw new Error("Something went wrong during fetching products");
      }
      const responseJson = await response.json();
      setProducts(responseJson._embedded.products);
    };
    fetchProducts().catch((e: any) => {
      setErrorMessage(e.message);
    });
  }, []);
  return (
    <>
      <div className="content-page">
        <div className="product-admin-head">
          <button className="btn btn-lg btn-primary waves-effect waves-light my-2 w-100">
            Add Product
          </button>
          <input placeholder="Search..." />
        </div>
        <Modal
          closeIcon
          open={open}
          trigger={<Button>Show Modal</Button>}
          onClose={() => setOpen(false)}
          onOpen={() => setOpen(true)}
        >
          <Header icon="archive" content="Archive Old Messages" />
          <Modal.Content>
            <p>
              Your inbox is getting full, would you like us to enable automatic
              archiving of old messages?
            </p>
          </Modal.Content>
          <Modal.Actions>
            <Button color="red" onClick={() => setOpen(false)}>
              <Icon name="remove" /> No
            </Button>
            <Button color="green" onClick={() => setOpen(false)}>
              <Icon name="checkmark" /> Yes
            </Button>
          </Modal.Actions>
        </Modal>
        <button className="ui button">Show Modal</button>

        <div className="table-responsive">
          <table className="table table-hover mb-0">
            <thead>
              <tr>
                <th>#Id</th>
                <th>Name</th>
                <th>Description</th>
                <th>price</th>
                <th>discount</th>
                <th>Discounted Price</th>
                <th>Created At</th>
                <th className="text-center">Manage</th>
              </tr>
            </thead>
            <tbody>
              {products?.map((product: ProductModel) => (
                <tr>
                  <td>{product?.productId}</td>
                  <td>{`${product?.productName.slice(0, 15)}...`}</td>
                  <td>{`${product?.productDescription.slice(0, 20)}...`}</td>
                  <td>
                    <span className="badge bg-success">{product?.price}$</span>
                  </td>
                  <td>
                    <span className="badge bg-warning">
                      {product?.discount}%
                    </span>
                  </td>

                  <td>
                    <span className="badge bg-danger">
                      {product.discountedPrice ? product.discountedPrice : 0}$
                    </span>
                  </td>
                  <td>{product.createdAt}</td>
                  <td>
                    <button className="btn btn-outline-danger waves-effect waves-light">
                      Delete
                    </button>
                    <button className="btn btn-outline-warning waves-effect waves-light mx-2">
                      Edit
                    </button>
                    <button className="btn btn-outline-success waves-effect waves-light">
                      Preview
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
};

export default ProductManagementPage;
